            <title>SteriTrack</title>
            <link rel="stylesheet" href='https://bootswatch.com/4/cerulean/bootstrap.min.css'>
            
            </link>
        </Head>
        <Home></Home>  
        <Navbar></Navbar>
        <div className='container'>
        
        </div>
       
    </div>
    );

    export default Layout;
